/// message : "Data Fetched Successfully"
/// response : {"avatar":"data:image/png;base64,"}
/// success : true

class GetProfileImageModel {
  GetProfileImageModel({
      this.message, 
      this.response, 
      this.success,});

  GetProfileImageModel.fromJson(dynamic json) {
    message = json['message'];
    response = json['response'] != null ? Response.fromJson(json['response']) : null;
    success = json['success'];
  }
  String? message;
  Response? response;
  bool? success;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['message'] = message;
    if (response != null) {
      map['response'] = response?.toJson();
    }
    map['success'] = success;
    return map;
  }

}

/// avatar : "data:image/png;base64,"

class Response {
  Response({
      this.avatar,});

  Response.fromJson(dynamic json) {
    avatar = json['avatar'];
  }
  String? avatar;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['avatar'] = avatar;
    return map;
  }

}